import React from "react";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import {Link as RouterLink} from "react-router-dom";
import Button from "@material-ui/core/Button";


const links = [
    {id: 1, to: "/", name: "Home"},
    {id: 2, to: "/game", name: "Game"},
    {id: 3, to: "/about", name: "About"},
]

const TopNavigation = () => {
    return (
        <AppBar  position="static" color="primary">
            <Toolbar style={{justifyContent: "center", alignItems: "center"}}>
                {links.map(link =>
                    <Button key={link.id} to={link.to} component={RouterLink} color="textPrimary"
                          underline="none" style={{paddingLeft: "2rem", paddingRight: "2rem"}}>{link.name}</Button>
                )}
            </Toolbar>
        </AppBar>
    )
}
export default TopNavigation;
